import "./index.css";
import Item from "../Item";

import { Todo } from "../../types";

interface ListProps {
  todos: Todo[];
  onComplete: (e) => void;
}

export default function List({ todos, onComplete }: ListProps) {
  return (
    <ul className="todo-main">
      {todos?.map((todo) => (
        <Item key={todo.id} onComplete={onComplete} todo={todo} />
      ))}
    </ul>
  );
}
